function updateDisplay():void {
	frameNum = parseInt(name.slice(1,name.length))+1;
	levelThumb.gotoAndStop(frameNum);
	if (unlocked) lockedClip.visible = false;
	else  lockedClip.visible = true;

	if (MovieClip(root).isKeyCollected(frameNum)) {
		relicClip.visible = true;
		relicClip.clip.gotoAndStop(frameNum);
	} else {
		relicClip.visible = false;
	}

